import styled from 'styled-components';

export const Button = styled.button`
  align-self: center;
  font-size: 20px;
  text-transform: uppercase;
  color: rgb(255, 255, 255);
  border: solid 2px rgb(255, 255, 255);
  border-radius: 10px;
  background-color: rgb(24, 33, 66);
  font-weight: 700;
  padding: 13px 45px;
`;
